import React from 'react';
import IntlMessages from '../../../../../util/IntlMessages';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import CardBox from '../../../../../components/CardBox/index';

class SubjectList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    const list = this.props.list;
    if (this.props.list) {
      return (
        <CardBox styleName="col-lg-12" >
          <div className="table-responsive-material">
            <Table className="default-table table-unbordered table table-sm table-hover">
              <TableHead className="th-border-b" >
                <TableRow>
                  <TableCell>{<IntlMessages id="subject.name" />}</TableCell>
                  <TableCell>{<IntlMessages id="subject.coefficient" />}</TableCell>
                  <TableCell>{<IntlMessages id="subject.horaires_officiels" />}</TableCell>
                  <TableCell>{<IntlMessages id="subject.horaires_supplementaires" />}</TableCell>
                  <TableCell></TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {list.map((subject, index) => {
                  return (
                    <TableRow key={index}>
                      <TableCell>{subject.name}</TableCell>
                      <TableCell>{subject.coefficient}</TableCell>
                      <TableCell>{subject.horaires_officiels}</TableCell>
                      <TableCell>{subject.horaires_supplementaires}</TableCell>
                    </TableRow>
                  );
                })}
              </TableBody>
            </Table>
          </div>
        </CardBox>
      )
    } else { return "" }
  }
}

export default SubjectList;
